import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <table width="100">
          <td>March 28th 2021</td>
          <td className="expense-Item__description">
              <h2>Car Insurance</h2>
          </td>
          <td className="expense-item__price">$294.67</td>
      </table>
    </div>
  );
}

export default ExpenseItem;
